import { Link } from "react-router-dom";

// Asset
import pokemonPic from "../assets/pikachu.png";

const Footer = () => {
  return (
    <footer>
        <Link to="/Pokemons">
            <img src="/images/pokeball.png" alt="Pokeball" />
            Pokemons
        </Link>
        <Link to="/Items">
            <img src="/images/pokeball.png" alt="Pokeball" />
            Items
        </Link>
        <Link to="/Map">
            <img src="/images/pokeball.png" alt="Pokeball" />
            Map
        </Link>
    </footer>
  );
};

export default Footer;
